import { Navigate } from "react-router-dom";
import { useAuth } from "../contexts/auth.context";

const ProtectedRoute = ({ children, onlyBiz }) => {
   const { user } = useAuth();

   if (!user || (onlyBiz && !user.biz)) {
      return <Navigate to={"/log-in"} />;
   }

   return children;
};

export default ProtectedRoute;
